import React from 'react'

const Siderbar = () => {
  return (
    <div className='sidebar'>
      <div className='logo-container'>
      color: var(--app-lhs-list-selected-color);
    align-items: flex-end;
    box-sizing: border-box;
    display: flex;
    padding-bottom: 7px;
    padding-top: 13px;
    user-select: none;
      </div>
    </div>
  )
}

export default Siderbar
